import { useState } from "react";
import { TextInput, View } from "react-native"



const  Datahandle=()=>{
const [name,setName]= useState();
const [age,setAge]= useState();
const [reg,setReg]= useState();
    return(
      <View>
        <TextInput 
        placeholder="Name"
        value={name}
        onChangeText={setName(value)}/>
        <TextInput 
        placeholder="Name"
        value={age}
        onChangeText={setAge}/>
        <TextInput 
        placeholder="Name"
        value={reg}
        onChangeText={setReg}/>
      </View>

    )
}
export default Datahandle;
